If I'm not mistaken, the remaining ones are either internal-only structs, like this

```C
struct {
  void *obfuscated[4];
} internal_data;
```

or structs with a `typedef` name but no tag, like this:

```C
typedef struct {
  size_t num_args;
  grpc_arg *args;
} grpc_channel_args;
```

The `typedef` names are sufficient for my purposes, since they can be used to retrieve layout information in just the same way as a tag:

```C
… offsetof(grpc_channel_args, args) …
```
